import React from "react";
import Button from "./button";
import Text from "./texts";

export default function Header(){
    return (
        <header className="flex px-[10%] py-[15px] items-center"
            style={{
                boxShadow: "0px 0px 32px grey"
            }}
        >
            <h1 className="text-[24px]">
                <span className="font-black text-[red]">RADIO</span>
                <span className="font-bold">VAULTS</span>
            </h1>

            <Text cls="ml-[50px]" size={"sm"}>
                Services
            </Text>

            <Button label={"Connect Wallet"} cls="ml-auto"/>
        </header>
    )
}
